import React from "react";
import "./AutoSwitch.css";
let state=0;

if (state==1){
    const Auto = () => (
        <div class = "Auto" id=""> 
            <button class="button Auto disabled">auto</button>
            <button class="button Manual">manual</button> 
        </div>

    );
};
if(state==0){
    const Auto = () => (

        <div class = "Auto" id=""> 
             <button class="button ">auto</button>
             <button class="button disabled">manual</button> 
        </div>

    );
};


export default Auto;
